/**
 * Provides the base implementation for all syntax loader plugins which automatically associates member methods
 * to syntax definitions invoking the method with escomplex settings and assigning the result to the same name as
 * the method.
 */
export default class AbstractSyntaxLoader
{
   /**
    * Loads all member methods including from child classes that are not `constructor` or `onConfigure`.
    *
    * @param {object}   ev - escomplex plugin event data.
    */
   onLoadSyntax(ev)
   {
      for (const name of s_GET_ALL_PROPERTY_NAMES(Object.getPrototypeOf(this)))
      {
         // Skip constructor and onConfigure method.
         if (!(this[name] instanceof Function) || name === 'constructor' || name === 'onConfigure') { continue; }

         ev.data.syntaxes[name] = this[name](ev.data.settings);
      }
   }
}

/**
 * Walks an objects inheritance tree collecting property names stopping before `AbstractSyntaxLoader` is reached.
 *
 * @param {object}   obj - object to walks.
 *
 * @returns {Array}
 * @ignore
 */
const s_GET_ALL_PROPERTY_NAMES = (obj) =>
{
   const props = [];

   do
   {
      Object.getOwnPropertyNames(obj).forEach((prop) => { if (props.indexOf(prop) === -1) { props.push(prop); } });
      obj = Object.getPrototypeOf(obj);
   } while (typeof obj !== 'undefined' && obj !== null && !(obj === AbstractSyntaxLoader.prototype));

   return props;
};

/**
 * Provides several helper methods to work with method oriented data stored as `this.aggregate` in `ClassReport` /
 * `ModuleReport` and directly in `MethodReport`.
 */
export default class AbstractReport
{
   /**
    * If given assigns the method report to an internal variable. This is used by `ClassReport` and `ModuleReport`
    * which stores a `MethodReport` respectively in `this.aggregate`.
    *
    * @param {MethodReport}   methodReport - A MethodReport to associate with this report.
    */
   constructor(methodReport)
   {
      /**
       * Stores any associated `MethodReport`.
       * @type {MethodReport}
       * @private
       */
      this._methodReport = methodReport;
   }

   /**
    * Cleans up any house keeping member variables.
    *
    * @returns {AbstractReport}
    */
   finalize()
   {
      delete this._methodReport;

      return this;
   }

   /**
    * Returns the associated `MethodReport` or `this`. Both ClassReport and ModuleReport have an `aggregate`
    * MethodReport.
    *
    * @returns {MethodReport}
    */
   get methodReport() { return typeof this._methodReport !== 'undefined' ? this._methodReport : this; }

   /**
    * Increments the associated MethodReport HalsteadData for distinct identifiers.
    *
    * @param {string}   metric - A Halstead metric name.
    * @param {string}   identifier - A Halstead identifier name.
    */
   incrementDistinctHalsteadItems(metric, identifier)
   {
      if (this.isHalsteadMetricDistinct(metric, identifier))
      {
         this.methodReport.halstead[metric].identifiers.push(identifier);

         this.incrementHalsteadMetric(metric, 'distinct');
      }
   }

   /**
    * Increments the associated MethodReport Halstead items including distinct and total counts.
    *
    * @param {string}   metric - A Halstead metric name.
    * @param {string}   identifier - A Halstead identifier name.
    */
   incrementHalsteadItems(metric, identifier)
   {
      this.incrementDistinctHalsteadItems(metric, identifier);

      // Increment total halstead items
      this.incrementHalsteadMetric(metric, 'total');
   }

   /**
    * Increments the associated MethodReport Halstead metric type.
    *
    * @param {string}   metric - A Halstead metric name.
    * @param {string}   type - A Halstead metric type.
    */
   incrementHalsteadMetric(metric, type)
   {
      this.methodReport.halstead[metric][type] += 1;
   }

   /**
    * Increments the associated MethodReport parameter count.
    *
    * @param {number}   count - Value to increase params by.
    */
   incrementParams(count)
   {
      this.methodReport.params += count;
   }

   /**
    * Returns true if a given HalsteadData metric / identifier is not found in the associated MethodReport.
    *
    * @param {string}   metric - A Halstead metric name.
    * @param {string}   identifier - A Halstead identifier name.
    *
    * @returns {boolean}
    */
   isHalsteadMetricDistinct(metric, identifier)
   {
      return this.methodReport.halstead[metric].identifiers.indexOf(identifier) === -1;
   }
}

import AbstractReport   from './AbstractReport';
import MethodReport     from './MethodReport';

/**
 * Provides a class report.
 */
export default class ClassReport extends AbstractReport
{
   /**
    * Initializes class report.
    *
    * @param {string}   name - Name of the class.
    * @param {number}   lineStart - Start line of class.
    * @param {number}   lineEnd - End line of class.
    */
   constructor(name = '', lineStart = 0, lineEnd = 0)
   {
      super(new MethodReport('', lineStart, lineEnd, 0));

      /**
       * Stores the aggregate method data.
       * @type {MethodReport}
       */
      this.aggregate = this._methodReport;

      /**
       * Stores the end line for the class.
       * @type {number}
       */
      this.lineEnd = lineEnd;

      /**
       * Stores the start line for the class.
       * @type {number}
       */
      this.lineStart = lineStart;

      /**
       * Stores all method data.
       * @type {Array<MethodReport>}
       */
      this.methods = [];

      /**
       * The name of the class.
       * @type {string}
       */
      this.name = name;
   }

   /**
    * Cleans up any house keeping member variables.
    *
    * @returns {ClassReport}
    */
   finalize()
   {
      super.finalize();

      this.methods.forEach((report) => { report.finalize(); });

      return this;
   }

   /**
    * Deserializes a JSON object representing a ClassReport.
    *
    * @param {object}   object - A JSON object of a ClassReport that was previously serialized.
    *
    * @returns {ClassReport}
    */
   static parse(object)
   {
      /* istanbul ignore if */
      if (typeof object !== 'object') { throw new TypeError('parse error: `object` is not an `object`.'); }

      const report = Object.assign(new ClassReport(), object);

      // Must explicitly assign `aggregate` to `report._methodReport` and re-assign data.
      report.aggregate = Object.assign(report._methodReport, object.aggregate);

      if (report.methods.length > 0)
      {
         report.methods = report.methods.map((report) => { return MethodReport.parse(report); });
      }

      return report;
   }
}

/**
 * Provides all Halstead metric data / parameters.
 * @see https://en.wikipedia.org/wiki/Halstead_complexity_measures
 */
export default class HalsteadData
{
   /**
    * Initializes the default Halstead data.
    */
   constructor()
   {
      /**
       * Measures an estimate for the number of potential errors.
       * @type {number}
       */
      this.bugs = 0;

      /**
       * Measures the difficulty of the program to write or understand.
       * @type {number}
       */
      this.difficulty = 0;

      /**
       * Measures the maintenance effort of the program.
       * @type {number}
       */
      this.effort = 0;

      /**
       * Defines the number of operands and operators.
       * @type {number}
       */
      this.length = 0;

      /**
       * Measures potential coding time.
       * @type {number}
       */
      this.time = 0;

      /**
       * Defines the unique number of operands and operators.
       * @type {number}
       */
      this.vocabulary = 0;

      /**
       * Measures how much information a reader of the code potential has to absorb to understand its meaning.
       * @type {number}
       */
      this.volume = 0;

      /**
       * In general an operand participates in actions associated with operators. A distinct and total count is provided
       * with all identifiers.
       * @type {{distinct: number, total: number, identifiers: Array<string>}}
       */
      this.operands = { distinct: 0, total: 0, identifiers: [] };

      /**
       * In general an operator carries out an action. A distinct and total count is provided with all identifiers.
       * @type {{distinct: number, total: number, identifiers: Array<string>}}
       */
      this.operators = { distinct: 0, total: 0, identifiers: [] };
   }

   /**
    * Resets the state of all Halstead data metrics without removing any operand or operator data.
    *
    * @param {boolean}  clearIdentifiers - Clears operands / operators; default: false.
    *
    * @returns {HalsteadData}
    */
   reset(clearIdentifiers = false)
   {
      Object.keys(this).forEach((key) => { if (typeof this[key] === 'number') { this[key] = 0; } });

      if (clearIdentifiers)
      {
         this.operands = { distinct: 0, total: 0, identifiers: [] };
         this.operators = { distinct: 0, total: 0, identifiers: [] };
      }

      return this;
   }
}

import AbstractReport   from './AbstractReport';
import HalsteadData     from './HalsteadData';

/**
 * Provides a method report.
 */
export default class MethodReport extends AbstractReport
{
   /**
    * Initializes method report.
    *
    * @param {string}   name - Name of the method.
    * @param {number}   lineStart - Start line of method.
    * @param {number}   lineEnd - End line of method.
    * @param {number}   params - Number of parameters for method.
    */
   constructor(name = '', lineStart = 0, lineEnd = 0, params = 0)
   {
      super();

      /**
       * The cyclomatic complexity of the method.
       * @type {number}
       */
      this.cyclomatic = 1;

      /**
       * The cyclomatic density of the method.
       * @type {number}
       */
      this.cyclomaticDensity = 0;

      /**
       * Stores the Halstead data instance.
       * @type {HalsteadData}
       */
      this.halstead = new HalsteadData();

      /**
       * Stores the end line for the method.
       * @type {number}
       */
      this.lineEnd = lineEnd;

      /**
       * Stores the start line for the method.
       * @type {number}
       */
      this.lineStart = lineStart;

      /**
       * The name of the method.
       * @type {string}
       */
      this.name = name;

      /**
       * The number of parameters for the method.
       * @type {number}
       */
      this.params = params;

      /**
       * The source lines of code for the method.
       * @type {{logical: number, physical: number}}
       */
      this.sloc = { logical: 0, physical: lineEnd - lineStart + 1 };
   }

   /**
    * Cleans up any house keeping member variables.
    *
    * @returns {MethodReport}
    */
   finalize()
   {
      super.finalize();

      return this;
   }

   /**
    * Provides a default array and indices for summing maintainability metrics.
    *
    * @returns {{sums: number[], indices: {cyclomatic: number, effort: number, loc: number, params: number}}}
    */
   static getMaintainabilityMetrics()
   {
      return { sums: [0, 0, 0, 0], indices: s_INDICES_MAINTAINABILITY };
   }

   /**
    * Deserializes a JSON object representing a MethodReport.
    *
    * @param {object}   object - A JSON object of a MethodReport that was previously serialized.
    *
    * @returns {MethodReport}
    */
   static parse(object)
   {
      /* istanbul ignore if */
      if (typeof object !== 'object') { throw new TypeError('parse error: `object` is not an `object`.'); }

      return Object.assign(new MethodReport(), object);
   }

   /**
    * Provides a convenience method to increment metric sums given an object hash of indices.
    *
    * @param {Array<number>}  sums - Running sums for metric calculation.
    * @param {object}         indices - Indices into the sums array for specific metrics.
    */
   sumMetrics(sums, indices)
   {
      /* istanbul ignore if */
      if (!Array.isArray(sums)) { throw new TypeError('sumMetrics error: `sums` is not an `array`.'); }

      /* istanbul ignore if */
      if (typeof indices !== 'object') { throw new TypeError('sumMetrics error: `indices` is not an `object`.'); }

      for (const key in indices)
      {
         switch (key)
         {
            case 'cyclomatic':
               sums[indices[key]] += this.cyclomatic;
               break;

            case 'effort':
               sums[indices[key]] += this.halstead.effort;
               break;

            case 'loc':
               sums[indices[key]] += this.sloc.logical;
               break;

            case 'params':
               sums[indices[key]] += this.params;
               break;
         }
      }
   }
}

/**
 * Defines the default maintainability metrics supported by `sumMetrics`.
 * @type {{cyclomatic: number, effort: number, loc: number, params: number}}
 * @ignore
 */
const s_INDICES_MAINTAINABILITY =
{
   cyclomatic: 0,
   effort: 1,
   loc: 2,
   params: 3
};

import AbstractReport   from './AbstractReport';
import ClassReport      from './ClassReport';
import MethodReport     from './MethodReport';

/**
 * Provides the default report object which stores data pertaining to a single file / module being processed.
 */
export default class ModuleReport extends AbstractReport
{
   /**
    * Initializes the report.
    *
    * @param {number}   lineStart - Start line of file / module.
    *
    * @param {number}   lineEnd - End line of file / module.
    *
    * @param {object}   settings - An object hash of the settings used in generating this report via ESComplexModule.
    */
   constructor(lineStart, lineEnd, settings = {})
   {
      super(new MethodReport('', lineStart, lineEnd, 0));

      /**
       * Stores the settings used to generate the module report.
       * @type {object}
       */
      this.settings = typeof settings === 'object' ? settings : {};

      /**
       * Stores the aggregate MethodReport for the module.
       * @type {MethodReport}
       */
      this.aggregate = this._methodReport;

      /**
       * Stores all ClassReport data for the module.
       * @type {Array<ClassReport>}
       */
      this.classes = [];

      /**
       * Measures the average method cyclomatic complexity of the module / file.
       * @type {number}
       */
      this.cyclomatic = 0;

      /**
       * Stores all parsed dependencies.
       * @type {Array}
       */
      this.dependencies = [];

      /**
       * Measures the average method maintenance effort of the module / file.
       * @type {number}
       */
      this.effort = 0;

      /**
       * Stores the file path of the module / file. The file path is only defined as supplied when processing projects.
       * @type {string}
       */
      this.filePath = undefined;

      /**
       * Stores the end line for the module / file.
       * @type {number}
       */
      this.lineEnd = lineEnd;

      /**
       * Stores the start line for the module / file.
       * @type {number}
       */
      this.lineStart = lineStart;

      /**
       * Measures the average method logical SLOC (source lines of code) for the module / file.
       * @type {number}
       */
      this.loc = 0;

      /**
       * Measures the average method maintainability index for the module / file.
       * @type {number}
       */
      this.maintainability = 0;

      /**
       * Stores all module MethodReport data found outside of any ES6 classes.
       * @type {Array<MethodReport>}
       */
      this.methods = [];

      /**
       * Measures the average number of method parameters for the module / file.
       * @type {number}
       */
      this.params = 0;

      /**
       * Stores the current class report scope stack.
       * @type {Array<ClassReport>}
       */
      this._scopeStackClass = [];

      /**
       * Stores the current method report scope stack.
       * @type {Array<MethodReport>}
       */
      this._scopeStackMethod = [];

      /**
       * Stores the active source path of the module / file. This path is respective of how the file is referenced in
       * the source code itself. `srcPath` is only defined as supplied when processing projects.
       * @type {string}
       */
      this.srcPath = undefined;

      /**
       * Stores the active source path alias of the module / file. This path is respective of how the file is
       * referenced in the source code itself when aliased including NPM and JSPM modules which provide a `main` entry.
       * `srcPathAlias` is only defined as supplied when processing projects.
       * @type {string}
       */
      this.srcPathAlias = undefined;
   }

   /**
    * Potentially adds given dependencies for tracking.
    *
    * @param {object|Array}   dependencies - Dependencies to add.
    */
   addDependencies(dependencies)
   {
      if (typeof dependencies === 'object' || Array.isArray(dependencies))
      {
         this.dependencies = this.dependencies.concat(dependencies);
      }
   }

   /**
    * Creates a report scope when a class or method is entered.
    *
    * @param {string}   type - Type of report to create.
    * @param {string}   name - Name of the class or method.
    * @param {number}   lineStart - Start line of method.
    * @param {number}   lineEnd - End line of method.
    * @param {number}   params - Number of parameters for method.
    *
    * @return {object}
    */
   createScope(type, name = '', lineStart = 0, lineEnd = 0, params = 0)
   {
      let report;

      switch (type)
      {
         case 'class':
            report = new ClassReport(name, lineStart, lineEnd);
            this.classes.push(report);
            this._scopeStackClass.push(report);
            break;

         case 'method':
         {
            report = new MethodReport(name, lineStart, lineEnd, params);

            // Increment aggregate method report params.
            this.incrementParams(params);

            // If an existing class report / scope exists also push the method to the class report.
            const classReport = this.getCurrentClassReport();

            if (classReport)
            {
               classReport.incrementParams(params);
               classReport.methods.push(report);
            }
            else
            {
               // Add this report to the module methods as there is no current class report.
               this.methods.push(report);
            }

            this._scopeStackMethod.push(report);

            break;
         }

         default:
            throw new Error(`createScope error: Unknown scope type (${type}).`);
      }

      return report;
   }

   /**
    * Cleans up any house keeping member variables.
    *
    * @returns {ModuleReport}
    */
   finalize()
   {
      super.finalize();

      this.classes.forEach((report) => { report.finalize(); });
      this.methods.forEach((report) => { report.finalize(); });

      delete this._scopeStackClass;
      delete this._scopeStackMethod;

      return this;
   }

   /**
    * Returns the current class report.
    *
    * @returns {ClassReport}
    */
   getCurrentClassReport()
   {
      return this._scopeStackClass.length > 0 ? this._scopeStackClass[this._scopeStackClass.length - 1] : void 0;
   }

   /**
    * Returns the current method report.
    *
    * @returns {MethodReport}
    */
   getCurrentMethodReport()
   {
      return this._scopeStackMethod.length > 0 ? this._scopeStackMethod[this._scopeStackMethod.length - 1] : void 0;
   }

   /**
    * Provides a default array and indices for summing maintainability metrics via `sumMetrics`.
    *
    * @returns {{sums: number[], indices: {cyclomatic: number, effort: number, loc: number, maintainability: number, params: number}}}
    */
   static getMaintainabilityMetrics()
   {
      return { sums: [0, 0, 0, 0, 0], indices: s_INDICES_MAINTAINABILITY };
   }

   /**
    * Increments the Halstead `metric` for the given `identifier` for the ModuleReport and any current class or method
    * report being tracked.
    *
    * @param {string}   metric - A Halstead metric name.
    * @param {string}   identifier - A Halstead identifier name.
    */
   halsteadItemEncountered(metric, identifier)
   {
      const currentClassReport = this.getCurrentClassReport();
      const currentMethodReport = this.getCurrentMethodReport();

      this.incrementHalsteadItems(metric, identifier);

      if (currentClassReport) { currentClassReport.incrementHalsteadItems(metric, identifier); }

      if (currentMethodReport) { currentMethodReport.incrementHalsteadItems(metric, identifier); }
   }

   /**
    * Increments the cyclomatic metric for the ModuleReport and any current class or method report being tracked.
    *
    * @param {number}   amount - Amount to increment.
    */
   incrementCyclomatic(amount)
   {
      const currentClassReport = this.getCurrentClassReport();
      const currentMethodReport = this.getCurrentMethodReport();

      this.aggregate.cyclomatic += amount;

      if (currentClassReport) { currentClassReport.aggregate.cyclomatic += amount; }
      if (currentMethodReport) { currentMethodReport.cyclomatic += amount; }
   }

   /**
    * Increments the logical SLOC (source lines of code) metric for the ModuleReport and any current class or method
    * report being tracked.
    *
    * @param {number}   amount - Amount to increment.
    */
   incrementLogicalSloc(amount)
   {
      const currentClassReport = this.getCurrentClassReport();
      const currentMethodReport = this.getCurrentMethodReport();

      this.aggregate.sloc.logical += amount;

      if (currentClassReport) { currentClassReport.aggregate.sloc.logical += amount; }
      if (currentMethodReport) { currentMethodReport.sloc.logical += amount; }
   }

   /**
    * Deserializes a JSON object representing a ModuleReport.
    *
    * @param {object}   object - A JSON object of a ModuleReport that was previously serialized.
    *
    * @returns {ModuleReport}
    */
   static parse(object)
   {
      /* istanbul ignore if */
      if (typeof object !== 'object') { throw new TypeError('parse error: `object` is not an `object`.'); }

      const report = Object.assign(new ModuleReport(), object);

      // Must explicitly assign `aggregate` to `report._methodReport` and re-assign data.
      report.aggregate = Object.assign(report._methodReport, object.aggregate);

      if (report.classes.length > 0)
      {
         report.classes = report.classes.map((report) => { return ClassReport.parse(report); });
      }

      if (report.methods.length > 0)
      {
         report.methods = report.methods.map((report) => { return MethodReport.parse(report); });
      }

      return report;
   }

   /**
    * Pops a report scope.
    *
    * @param {string} type - The report scope `class` or `method` to pop off the given stack.
    * @returns {*}
    */
   popScope(type)
   {
      switch (type)
      {
         case 'class':
            this._scopeStackClass.pop();
            return this.getCurrentClassReport();

         case 'method':
            this._scopeStackMethod.pop();
            return this.getCurrentMethodReport();

         default:
            throw new Error(`popScope error: Unknown scope type (${type}).`);
      }
   }

   /**
    * Processes all TraitHalstead identifier data.
    *
    * @param {ModuleReport}   metric - The Halstead metric being processed.
    * @param {Array<string>}  identifiers - An array of Halstead identifiers.
    */
   processHalsteadItems(metric, identifiers)
   {
      identifiers.forEach((identifier) =>
      {
         this.halsteadItemEncountered(metric, identifier);
      });
   }

   /**
    * Provides a convenience method to increment metric sums given an object hash of indices.
    *
    * @param {Array<number>}  sums - Running sums for metric calculation.
    * @param {object}         indices - Indices into the sums array for specific metrics.
    */
   sumMetrics(sums, indices = {})
   {
      /* istanbul ignore if */
      if (!Array.isArray(sums)) { throw new TypeError('sumMetrics error: `sums` is not an `array`.'); }

      /* istanbul ignore if */
      if (typeof indices !== 'object') { throw new TypeError('sumMetrics error: `indices` is not an `object`.'); }

      for (const key in indices) { sums[indices[key]] += typeof this[key] === 'number' ? this[key] : 0; }
   }
}

/**
 * Defines the default maintainability metrics supported by `sumMetrics`.
 * @type {{cyclomatic: number, effort: number, loc: number, maintainability: number, params: number}}
 * @ignore
 */
const s_INDICES_MAINTAINABILITY =
{
   cyclomatic: 0,
   effort: 1,
   loc: 2,
   maintainability: 3,
   params: 4
};

import TraitHalstead from './TraitHalstead';

/**
 * Provides a wrapper around an array of Halstead properties object hashes which should contain an
 * `identifier` field and potentially a `filter` field.
 */
export default class HalsteadArray
{
   /**
    * Initializes HalsteadArray by normalizing any Halstead properties converting them into TraitHalstead instances.
    *
    * @param {string}               metric - The name of Halstead metric being stored.
    * @param {Array<object|string>} data - An array of Halstead properties.
    */
   constructor(metric, data)
   {
      /* istanbul ignore if */
      if (typeof metric !== 'string') { throw new TypeError('ctor error: metric is not a `string`.'); }

      /* istanbul ignore if */
      if (!Array.isArray(data)) { throw new TypeError('ctor error: data is not an `Array`.'); }

      /**
       * Stores an array of normalized Halstead property data to an object hash that has an `identifier` entry.
       * @type {Array<TraitHalstead>}
       * @private
       */
      this._data = data.map((property) =>
      {
         return property && typeof property.identifier !== 'undefined' ? new TraitHalstead(metric, property) :
          new TraitHalstead(metric, { identifier: property });
      });

      /**
       * Stores the Halstead metric type.
       * @type {string}
       * @private
       */
      this._metric = metric;
   }

   /**
    * Allows custom processing of TraitHalstead data.
    *
    * @param {function} method - A custom method to process each TraitHalstead data.
    */
   forEach(method)
   {
      this._data.forEach(method);
   }

   /**
    * Returns a TraitHalstead entry at the given index.
    *
    * @param {number}   index - Index to access.
    *
    * @returns {TraitHalstead}
    */
   get(index)
   {
      return this._data[index];
   }

   /**
    * Returns the length of wrapped TraitHalstead data.
    *
    * @returns {number}
    */
   get length() { return this._data.length; }

   /**
    * Returns the associated metric type.
    *
    * @returns {string}
    */
   get metric() { return this._metric; }

   /**
    * Returns the typeof data being wrapped.
    *
    * @returns {string}
    */
   get type() { return typeof this._data; }

   /**
    * Returns an array of evaluated TraitHalstead data as the value of the `identifier` field of the wrapped data.
    * Additionally the TraitHalstead filter function is invoked with the given parameters removing any values that
    * fail the filter test.
    *
    * @param {*}  params - Provides parameters which are forwarded onto any data stored as a function. Normally
    *                      `params` should be the `current AST node, parent AST node, ... optional data`.
    *
    * @returns {Array<string>}
    */
   valueOf(...params)
   {
      const filtered = this._data.filter((traitHalstead) =>
      {
         return typeof traitHalstead.valueOf(...params) !== 'undefined' && traitHalstead.filter(...params);
      });

      // Map all TraitHalstead data and flatten any array of identifiers returned from `valueOf`.
      return [].concat(...filtered.map((traitHalstead) => { return traitHalstead.valueOf(...params); }));
   }
}

/**
 * Provides a wrapper around a data field which may be an array, function or other primitive value.
 */
export default class Trait
{
   /**
    * Initializes trait data.
    *
    * @param {string}   metric - The name of Halstead metric being stored.
    * @param {*}        data - Data to wrap.
    */
   constructor(metric, data)
   {
      /* istanbul ignore if */
      if (typeof metric !== 'string') { throw new TypeError('ctor error: metric is not a `string`.'); }

      /**
       * Stores the data to wrap.
       * @type {*}
       * @private
       */
      this._data = data;

      /**
       * Stores the Trait metric type.
       * @type {string}
       * @private
       */
      this._metric = metric;
   }

   /**
    * Returns the associated metric type.
    *
    * @returns {string}
    */
   get metric() { return this._metric; }

   /**
    * Returns the typeof data being wrapped.
    *
    * @returns {string}
    */
   get type() { return typeof this._data; }

   /**
    * Returns the value of the given data. If the wrapped data is a function it is invoked with the given `params`
    * otherwise the data is returned directly. If the wrapped data is an array a mapped version is returned
    * with each entry that is a function being invoked with the given `params`.
    *
    * @param {*}  params - Provides parameters which are forwarded onto any data stored as a function. Normally
    *                      `params` should be the `current AST node, parent AST node, ... optional data`.
    *
    * @returns {*}
    */
   valueOf(...params)
   {
      if (Array.isArray(this._data))
      {
         return this._data.map((entry) => { return typeof entry === 'function' ? entry(...params) : entry; });
      }

      return typeof this._data === 'function' ? this._data(...params) : this._data;
   }
}

/**
 * Provides a wrapper around a data object hash which should contain an `identifier` field and potentially a `filter`
 * field which is a function. The identifier can be a function or string or an array of functions / strings.
 */
export default class TraitHalstead
{
   /**
    * Initializes the Halstead trait.
    *
    * @param {string}   metric - The name of Halstead metric being stored.
    * @param {object}   data - The data field to be wrapped.
    */
   constructor(metric, data)
   {
      /* istanbul ignore if */
      if (typeof metric !== 'string') { throw new TypeError('ctor error: metric is not a `string`.'); }

      /* istanbul ignore if */
      if (typeof data !== 'object') { throw new TypeError('ctor error: data is not an `object`.'); }

      /* istanbul ignore if */
      if (Array.isArray(data.identifier))
      {
         data.identifier.forEach((element, index) =>
         {
            if (element !== 'function' && typeof element !== 'string')
            {
               throw new TypeError(
                `ctor error: data.identifier array is not a 'function' or 'string' at index: ${index}.`);
            }
         });
      }
      else
      {
         /* istanbul ignore if */
         if (typeof data.identifier !== 'function' && typeof data.identifier !== 'string')
         {
            throw new TypeError('ctor error: data.identifier is not a `function` or `string`.');
         }
      }

      /* istanbul ignore if */
      if (typeof data.filter !== 'undefined' && typeof data.filter !== 'function')
      {
         throw new TypeError('ctor error: data.filter is not a `function`.');
      }

      /**
       * Stores the data to wrap.
       * @type {*}
       * @private
       */
      this._data = data;

      /**
       * Stores the Halstead metric type.
       * @type {string}
       * @private
       */
      this._metric = metric;
   }

   /**
    * Returns the value of the `filter` field of the wrapped data. If the wrapped `filter` field is a function it
    * is invoked with the given `params` otherwise the data is returned directly. If `filter` is not defined then
    * `true` is returned.
    *
    * @param {*}  params - Provides parameters which are forwarded onto any data stored as a function. Normally
    *                      `params` should be the `current AST node, parent AST node, ... optional data`.
    *
    * @returns {boolean}
    */
   filter(...params)
   {
      return typeof this._data.filter === 'function' ? this._data.filter(...params) : true;
   }

   /**
    * Returns the associated metric type.
    *
    * @returns {string}
    */
   get metric() { return this._metric; }

   /**
    * Returns the typeof data being wrapped.
    *
    * @returns {string}
    */
   get type() { return typeof this._data; }

   /**
    * Returns the value of the `identifier` field of the wrapped data. If the wrapped `identifier` field is a function
    * it is invoked with the given `params` otherwise the data is returned directly.
    *
    * @param {*}  params - Provides parameters which are forwarded onto any data stored as a function.
    *
    * @returns {string|Array<string>}
    */
   valueOf(...params)
   {
      if (Array.isArray(this._data.identifier))
      {
         return this._data.identifier.map((entry) =>
         {
            return typeof entry === 'function' ? entry(...params) : entry;
         });
      }

      return typeof this._data.identifier === 'function' ? this._data.identifier(...params) : this._data.identifier;
   }
}

import HalsteadArray from './HalsteadArray';
import Trait         from './Trait';

import safeArray     from './safeArray';

/**
 * Provides a helper method to format core traits for escomplex processing.
 *
 * @param {function|number}         lloc - Logical lines of code
 * @param {function|number}         cyclomatic - The number of linearly independent paths through source code.
 * @param {function|string|Array}   operators - An operator carries out an action.
 * @param {function|string|Array}   operands - An operand participates in such an action (operator).
 * @param {function|string|Array}   ignoreKeys - Provides a list of AST node children keys to skip traversal.
 * @param {function|string}         newScope - Creates a new `class` or `method` scope for report generation.
 * @param {function|object|Array}   dependencies - An import / require dependency.
 *
 * @returns {{lloc: Trait, cyclomatic: Trait, operators: HalsteadArray, operands: HalsteadArray, ignoreKeys: Trait, newScope: Trait, dependencies: Trait}}
 */
export default function(lloc = 0, cyclomatic = 0, operators = undefined, operands = undefined,
 ignoreKeys = undefined, newScope = undefined, dependencies = undefined)
{
   return {
      lloc: new Trait('lloc', lloc),
      cyclomatic: new Trait('cyclomatic', cyclomatic),
      operators: new HalsteadArray('operators', safeArray(operators)),
      operands: new HalsteadArray('operands', safeArray(operands)),
      ignoreKeys: new Trait('ignoreKeys', safeArray(ignoreKeys)),
      newScope: new Trait('newScope', newScope),
      dependencies: new Trait('dependencies', dependencies)
   };
}

/**
 * Provides safe array creation from a given input.
 *
 * @param {*}  value - A value to potentially convert into a safe array.
 *
 * @returns {Array}
 */
export default function(value)
{
   return typeof value === 'undefined' || value === null ? [] : Array.isArray(value) ? value : [value];
}

/**
 * Provides a utility method that defers to `object.name` if it exists or fallback to `defaultName` or `anonymous`.
 *
 * @param {object}   object - The target object to provide safe name coverage.
 * @param {string}   defaultName - A default name to fallback to if `object.name` is missing.
 *
 * @returns {string}
 */
export default function(object, defaultName = '')
{
   if (object !== null && typeof object === 'object' && typeof object.name === 'string' && object.name !== '')
   {
      return object.name;
   }

   if (typeof defaultName === 'string' && defaultName !== '') { return defaultName; }

   return '<anonymous>';
}

import ModuleReport  from  '../../module/report/ModuleReport';
import StringUtil    from  '../../utils/StringUtil';

/**
 * Provides the default project report object which stores data pertaining to all modules / files contained.
 */
export default class ProjectResult
{
   /**
    * Initializes ProjectReport with default values.
    *
    * @param {Array<ModuleReport>}  moduleReports - An array of ModuleReports for each module / file processed.
    *
    * @param {object}               settings - An object hash of the settings used in generating this report via
    *                                          ESComplexProject.
    */
   constructor(moduleReports, settings = {})
   {
      /**
       * Stores the settings used to generate the project report.
       * @type {object}
       */
      this.settings = typeof settings === 'object' ? settings : {};

      /**
       * Stores a compacted form of the adjacency matrix. Each row index corresponds to the same report index.
       * Each row entry corresponds to a report index. These relationships dictate the dependencies between all
       * report ModuleReports given the source paths.
       *
       * @type {Array<Array<number>>}
       */
      this.adjacencyList = undefined;

      /**
       * Measures the average percentage of modules affected when one module / file in the project is changed.
       * Lower is better.
       * @type {number}
       */
      this.changeCost = 0;

      /**
       * Measures the percentage of modules that are widely depended on which also depend on other modules.
       * Lower is better.
       * @type {number}
       */
      this.coreSize = 0;

      /**
       * Measures the average method cyclomatic complexity for the project.
       * @type {number}
       */
      this.cyclomatic = 0;

      /**
       * Measures the average method maintenance effort for the project.
       * @type {number}
       */
      this.effort = 0;

      /**
       * Measures the percentage of all possible internal dependencies that are actually realized in the project.
       * Lower is better.
       * @type {number}
       */
      this.firstOrderDensity = 0;

      /**
       * Measures the average method logical SLOC (source lines of code) for the project.
       * @type {number}
       */
      this.loc = 0;

      /**
       * Measures the average method maintainability index for the project.
       * @type {number}
       */
      this.maintainability = 0;

      /**
       * Measures the average number of method parameters for the project.
       * @type {number}
       */
      this.params = 0;

      /**
       * Stores all ModuleReport data for the project sorted by the module / files `srcPath`.
       * @type {Array<ModuleReport>}
       */
      this.reports = Array.isArray(moduleReports) ?
       moduleReports.sort((lhs, rhs) => { return StringUtil.compare(lhs.srcPath, rhs.srcPath); }) : [];

      /**
       * Stores a compacted form of the visibility matrix. Each row index corresponds to the same report index.
       * Each row entry corresponds to a report index. These relationships dictate the reverse visibility between all
       * report ModuleReports which may indirectly impact the given module / file.
       *
       * @type {Array<Array<number>>}
       */
      this.visibilityList = undefined;
   }

   /**
    * Finalizes the ProjectResult. If `settings.serializeReports` is false output just `filePath`, `srcPath` &
    * `srcPathAlias` entries of reports.
    *
    * @returns {ProjectResult}
    */
   finalize()
   {
      if (typeof this.settings.serializeReports === 'boolean' && !this.settings.serializeReports)
      {
         this.reports = this.reports.map((report) =>
         {
            return { filePath: report.filePath, srcPath: report.srcPath, srcPathAlias: report.srcPathAlias };
         });
      }
      else
      {
         this.reports.forEach((report) => { report.finalize(); });
      }

      return this;
   }

   /**
    * Deserializes a JSON object representing a ProjectResult.
    *
    * @param {object}   object - A JSON object of a ProjectResult that was previously serialized.
    *
    * @returns {ProjectResult}
    */
   static parse(object)
   {
      /* istanbul ignore if */
      if (typeof object !== 'object') { throw new TypeError('parse error: `object` is not an `object`.'); }

      const result = Object.assign(new ProjectResult(), object);

      if (result.reports.length > 0)
      {
         result.reports = result.reports.map((report) => { return ModuleReport.parse(report); });
      }

      return result;
   }

   /**
    * Returns a string representing the adjacency relationships by printing out the report index followed by
    * dependent ModuleReport indices / `srcPaths`.
    *
    * @returns {string}
    */
   toStringAdjacency()
   {
      let result = '';

      /* istanbul ignore if */
      if (!Array.isArray(this.adjacencyList)) { return result; }

      this.reports.forEach((report, index) =>
      {
         result += `${index}:\t${report.srcPath}\n`;

         this.adjacencyList[index].forEach((reportIndex) =>
         {
            result += `\t${reportIndex}:\t${this.reports[reportIndex].srcPath}\n`;
         });

         result += '\n';
      });

      return result;
   }

   /**
    * Returns a string representing the visibilty relationships by printing out the report index followed by
    * indirect reverse dependency ModuleReport indices / `srcPaths`.
    *
    * @returns {string}
    */
   toStringVisibility()
   {
      let result = '';

      /* istanbul ignore if */
      if (!Array.isArray(this.visibilityList)) { return result; }

      this.reports.forEach((report, index) =>
      {
         result += `${index}:\t${report.srcPath}\n`;

         this.visibilityList[index].forEach((reportIndex) =>
         {
            result += `\t${reportIndex}:\t${this.reports[reportIndex].srcPath}\n`;
         });

         result += '\n';
      });

      return result;
   }
}

/**
 * Provides common math utilities.
 */
export default class MathUtil
{
   /**
    * Compacts a 2D matrix testing entries against a testValue with a default value of `1` for inclusion. The resulting
    * compacted list has an array per row with entries that correspond to the column index that passed the test.
    *
    * @param {Array<Array<number>>} matrix - A matrix to compact / compress.
    * @param {*}                    testValue - A value to test strict equality to include entry for compaction.
    *
    * @returns {Array<Array<number>>}
    */
   static compactMatrix(matrix, testValue = 1)
   {
      const compacted = [];

      matrix.forEach((row) =>
      {
         const rowArray = [];
         compacted.push(rowArray);

         row.forEach((entry, entryIndex) => { if (entry === testValue) { rowArray.push(entryIndex); } });
      });

      return compacted;
   }

   /**
    * Creates an 2-dimensional array of the given length.
    *
    * @param {number}   length - Array length for x / y dimensions.
    * @param {number}   value - Default value.
    *
    * @return {Array<Array<number>>}
    */
   static create2DArray(length = 0, value = 0)
   {
      const array = new Array(length);

      for (let cntr = 0; cntr < length; cntr++) { array[cntr] = new Array(length); }

      for (let i = 0; i < length; i++)
      {
         for (let j = 0; j < length; j++) { array[i][j] = value; }
      }

      return array;
   }

   /**
    * Returns the median / middle value from the given array after sorting numerically. If values length is odd the
    * middle value in the array is returned otherwise if even two middle values are summed then divided by 2.
    *
    * @param {Array<number>}  values - An Array of numerical values.
    *
    * @returns {number}
    */
   static getMedian(values)
   {
      // Sort by number.
      values.sort((lhs, rhs) => { return lhs - rhs; });

      // Checks of values.length is odd.
      if (values.length % 2) { return values[(values.length - 1) / 2]; }

      return (values[(values.length - 2) / 2] + values[values.length / 2]) / 2;
   }

   /**
    * Returns the percent of a given value and limit.
    *
    * @param {number}   value - A `value` to calculate the percentage against the given `limit`.
    * @param {number}   limit - A base `limit` that constrains the `value`.
    *
    * @returns {number}
    */
   static getPercent(value, limit)
   {
      return limit === 0 ? 0 : (value / limit) * 100;
   }
}

/**
 * Provides common string utilities.
 */
export default class StringUtil
{
   /**
    * Compares two strings.
    *
    * @param {string}   lhs - Left-hand side.
    * @param {string}   rhs - Right-hand side.
    *
    * @returns {number}
    */
   static compare(lhs, rhs)
   {
      return lhs.toLowerCase().localeCompare(rhs.toLowerCase());
   }
}
